class Template{constructor(e,t,r){this.templateName=e,this.parentBlock=t,this.data=r}}class AbstractRender{constructor(){}render(e){throw new Error("Must be implement by a subclass !")}}class RenderExternalTemplate extends AbstractRender{constructor(){super()}render(e){$.when($.get(e.templateName)).done(function(t){$.templates({tmpl:t}),$(e.parentBlock).html($.render.tmpl(e.data))})}}class RenderLocalTemplate extends AbstractRender{constructor(){super()}render(e){const t=$.templates(e.templateName).render(e.data);$(e.parentBlock).html(t)}}